INSERT INTO `goods` VALUES (1,'怡弘笔庄书法画画毛笔','笔',9.90,9.90,111,'怡弘笔庄书法画画毛笔 外锋3.9mm，口径0.9mm','笔锋精选羊豪+狼毫制作而成，毛料细腻，笔锋柔顺，弹性适中，聚锋能力强。适合各类楷书、行书、棣书和写意国画等。','2024-06-16 22:10:05','2024-06-16 22:10:05',0),(2,'徽昕斋古狼狼毫毛笔','笔',19.90,19.90,127,'徽昕斋古狼狼毫毛笔 材料：羊毫狼尾','总长29.5cm， 笔肚直径1.5cm ，出峰5.5cm。饱吸墨水不分叉,性能柔和，宜写正、草、行篆、隶各种书法和泼墨山水、写意花卉。弹性极好,经久耐用!','2024-06-16 22:10:05','2024-06-16 22:10:05',0),(3,'春云笔庄毛笔','笔',29.90,29.90,124,'春云笔庄毛笔','春云笔庄狼羊兼材质精品毛笔，笔杆全木杆制作而成，名家工艺制作，适合楷书、隶书、行书，受锋好，弹性大，美观大方，造型古朴。','2024-06-16 22:10:05','2024-06-16 22:10:05',0),(4,'弘扬轩精典狼毫创作练习毛笔','笔',39.90,39.90,7780,'弘扬轩精典狼毫创作练习毛笔','笔杆全木直竹杆制作，笔头狼毛尼龙毛制作而成，适合书写小楷、信筏和小手札，提能聚锋，按能铺毫，可写范围6cm以内','2024-06-16 22:10:05','2024-06-16 22:10:05',0),(5,'善琏湖笔狼毫毛笔【高档礼盒 送笔架】','笔',49.90,49.90,777,'善琏湖笔狼毫毛笔【高档礼盒 送笔架】','精选纯东北狼尾制作，笔杆为鸡翅木斗款式，用料制工精细，笔尖锋利，真材实料，手工制作。如你需要的是一支很“硬”很“弹”很“尖”的笔，此笔良选。','2024-06-16 22:10:05','2024-06-16 22:10:05',0),(6,'一得阁书画墨汁500g书法专用墨汁毛笔墨水','墨',19.90,19.90,8,'一得阁书画墨汁500g书法专用墨汁毛笔墨水','一得阁始创于1865年，百年经典，值得信赖！墨汁浓度适中，无需兑水或者白酒。','2024-06-16 22:10:05','2024-06-16 22:10:05',0),(7,'曹素功书画墨汁','墨',22.90,22.90,202,'曹素功书画墨汁','由桐油烟、珍珠、玉屑等中药材制作而成，古法制作、用料天然、墨色润泽。书写浓淡层次丰富，干透明了，具有玉油烟墨相仿的书画效果。','2024-06-16 22:10:05','2024-06-16 22:10:05',0),(8,'合三舍墨汁','墨',28.80,28.80,43,'合三舍墨汁','材质为油烟墨，规格250g，墨色黑亮，书写丝滑不滞笔。','2024-06-16 22:10:05','2024-06-16 22:10:05',0),(9,'曹一阁墨汁书法专用大瓶古制油烟墨','墨',33.30,33.30,25,'曹一阁墨汁书法专用大瓶古制油烟墨','古制油烟墨，作品级墨汁，优质原料，古法制墨，墨香清幽，书写坚而有光，黝而能润，浓度始终，安全品质，放心购买。','2024-06-16 22:10:05','2024-06-16 22:10:05',0),(10,'毛边纸宣纸','纸',1.90,1.90,2,'毛边纸宣纸','毛边书法纸，匠心制作，书写流畅，手工纸浆半生半熟，吸墨均匀。','2024-06-16 22:10:05','2024-06-16 22:10:05',0),(11,'湖羊毛边纸书法练字专用宣纸','纸',3.90,3.90,99,'湖羊毛边纸书法练字专用宣纸','原生态竹浆纸，适合学生、成人、初学者使用，纸质柔软半生熟，韧性强，拉力好，吸墨吸水均佳。','2024-06-16 22:10:05','2024-06-16 22:10:05',0),(12,'檀旗手工檀皮宣纸书法专用','纸',8.90,8.90,153,'檀旗手工檀皮宣纸书法专用','加厚檀皮宣，创作专业，宜书宜画，原产地直发。适用书法国画，纸质细腻，书画流畅，层次分明，书写墨色黑亮。','2024-06-16 22:10:05','2024-06-16 22:10:05',0),(13,'特级纯手工纯竹浆元书纸','纸',11.90,11.90,4732,'特级纯手工纯竹浆元书纸','手工蝉翼毛边纸，天然竹浆，纯手工古法制作，纸张细腻轻薄，书写质感优越。','2024-06-16 22:10:05','2024-06-16 22:10:05',0),(14,'问心堂歙砚新坑初学者砚台','砚',39.90,39.90,1215,'问心堂歙砚新坑初学者砚台','这款砚台小巧精细，便于随身携带，原料取自歙砚新坑，色泽黑亮，质感细腻。砚石中保留了自然形成的金星点缀，宛如星月当空。','2024-06-16 22:10:05','2024-06-16 22:10:05',0),(15,'天然原石砚台','砚',79.90,79.90,1204,'天然原石砚台','天然原石砚台由天然岩石制作而成，研磨细腻，发模块，舔笔不伤笔，不损毫。','2024-06-16 22:10:05','2024-06-16 22:10:05',0),(16,'曹一阁全新升级火锅砚台','砚',88.98,88.98,124,'曹一阁全新升级火锅砚台','本砚台方便舔毛，不伤毫，加厚加深内圈，墨汁湿润长久，可有效防止菱角边缘划伤毫料。自带砚盖，可长效保湿墨汁，','2024-06-16 22:10:05','2024-06-16 22:10:05',0),(17,'青云笔社端砚砚台','砚',109.90,109.90,2788,'青云笔社端砚砚台','这款砚台一直非常受欢迎，大小上使用了更加适合研磨的5寸，同时沿用薄砚造型，方便携带；石料上选用了优质宋坑料，下墨更快。','2024-06-16 20:30:48','2024-06-16 20:30:48',0),(18,'国家非遗《带盖歙砚》初学者砚台','砚',189.90,189.90,347,'国家非遗《带盖歙砚》初学者砚台','本砚台由老坑原石歙砚制作而成，自带砚盖，色泽艳丽，浑然一体，搭配美观，实用优惠，购买砚台送墨块。','2024-06-16 20:30:48','2024-06-16 20:30:48',0);
